import React, { Fragment } from 'react';
import { Container, Jumbotron, Row, Col, Image, Media, Button } from 'reactstrap';
import './../resources/css/Landing.css';


import avaLogo from './../resources/images/avaLogo.png';
import avarentLogo from './../resources/images/avarentLogo.jpg';

const Landing = (props) => {

    return (
        <Fragment>
            <Container>
                <Row>
                    <Col className="text-center">
                        {/*<h1>AvaRent</h1>*/}
                        <img src={avarentLogo} className="img-fluid"></img>
                        <br />
                    </Col>
                </Row>
                <Row>
                {/*    <Col lg="4">
                        <img src={avaLogo} className="img-fluid"></img>
                    </Col>*/}
                    <Col lg="6">
                        <Button  outline color="primary" size="m" block class="btn">Current Tenant</Button>                       
                    </Col>
                    <Col lg="6">
                        <Button outline color="primary" size="m" block>Sign up for waiting list</Button>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
};
export default Landing;
